MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The Calibre xACT products consist of CalibrexACT, Calibre xACT 3D, and Calibre xACTView. ");
MGCAddSnippet(6, "The Calibre xACT products consist of Calibre xACT, Calibre xACT 3D, and Calibre xACTView. ");
MGCAddSnippet(7, "Calibre xACT calculates parasitic and coupling effects. This information is essential for driving static timing analysis tools. Calibre xACT sits between Place & Route and static timing analysis in the digital design flow. You should run this tool only after it passes DRC and LVS checks. ");
MGCAddSnippet(8, "Calibre xACT and Calibre xACT 3D provide information about parasitic and coupling effects that are essential for full custom design flows. After full custom layout is completed, and DRC and LVS checks are clean, use Calibre xACT or Calibre xACT 3D to generate accurate netlists for use in simulation tools.");
MGCAddSnippet(9, "Calibre xACT encompasses sign-off parasitic extraction capabilities for cell-based (digital) flows as well as for transistor-based (custom). The digital extraction capabilities of Calibre xACT deliver the full-chip performance and sign-off accuracy needed for large digital designs. Calibre xACT reads LEF and DEF data directly, uses foundry-supported rule decks, and retains all connectivity information from the original design. It generates SPEF netlist output that is then used for static timing analysis. Although the Calibre xACT transistor-based (custom) flows only support 16nm and smaller processes, the Calibre xACT cell-based (digital) flows support all foundries and process geometries for which CalibrexRC or Calibre xACT extraction rules are available.");
MGCAddSnippet(10, "Calibre xACT is a high-performance high-accuracy parasitic extraction tool that calculates parasitic capacitance and resistance in an IC layout and generates transistor-level parasitic netlists and reports. The netlists can be simulated with transistor-level post-layout analysis tools.");
MGCAddSnippet(11, "Calibre xACT 3D is a high-accuracy parasitic extraction tool that generates parasitic netlists and reports using fast field solver technology for capacitance extraction. It calculates parasitic resistance and capacitance in an IC layout and outputs a simulatable netlist. ");
MGCAddSnippet(12, "As designs become more dense and interconnects get longer it is important to consider parasitic inductance effects for sensitive and high frequency designs. The inductance extraction capabilities of Calibre xACT are fully integrated within the Calibre LVS extraction solution. Use the Calibre xACT Inductance flow to generate optimized and accurate RLC netlists needed for fast post-layout simulations. ");
MGCAddSnippet(13, "Calibre xACTView is a 3D layout viewer used to visualize and debug test cases, and to view the technology stack used in integrated circuit designs. A 3D layout viewer is an essential component of standard field solvers. It provides the ability to graphically view the different polygons processed for capacitance extraction as seen by the field solver. ");
MGCAddSnippet(14, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(15, "The Calibre xACT extraction flow for advanced process nodes offers many possible customizations based on your particular needs.");
MGCAddSnippet(16, "Certain conditions must be met before running the Calibre xACT tool.");
MGCAddSnippet(17, "The top-level control file is an SVRF rule file that contains all the settings necessary to run Calibre xACT. This example describes a set of statements used in a GDS flow.");
MGCAddSnippet(18, "When performing extraction with layout names, Calibre xACT runs all stages of extraction including device recognition, parasitic calculations, and netlisting. ");
MGCAddSnippet(19, "When performing extraction with source names, Calibre LVS must be run for device recognition. Calibre xACT runs the remaining stages of extraction including parasitic calculations and netlisting. ");
MGCAddSnippet(20, "The CalibreInteractive Graphical User Interface (GUI) provides an interface to the Calibre xACT tool.");
MGCAddSnippet(21, "The Calibre xACT tool has its own graphical user interface (GUI) in Calibre Interactive. The GUI can be invoked from the command line or from Calibre DESIGNrev. ");
MGCAddSnippet(22, "After you invoke Calibre Interactive - xACT, you are prompted to specify a runset. A runset sets default values and can be useful for managing your different types of extractions. ");
MGCAddSnippet(23, "Parasitic extraction requires a pre-defined rules file. Use this procedure to specify and load a rule file in Calibre Interactive - xACT. ");
MGCAddSnippet(24, "The input data varies depending on how you invoked Calibre Interactive and the type of extraction you plan to run.");
MGCAddSnippet(25, "The design layout information is specified on the Inputs pane in the Layout Path field. A red exclamation point is displayed next to Inputs if any required settings are specified incorrectly or missing.");
MGCAddSnippet(26, "The schematic netlist or source file information is specified on the Inputs pane in the Source Path field. A red exclamation point is displayed next to Inputs if any required settings are specified incorrectly or missing.");
MGCAddSnippet(27, "Use the Outputs pane to specify the type of extraction output that is generated. ");
MGCAddSnippet(28, "In Calibre Interactive - xACT the default extraction mode is set to xACT. Use xACT Mode to change the extraction mode.");
MGCAddSnippet(29, "Specify the type of extraction you would like to perform.");
MGCAddSnippet(30, "Specify the PEX netlist output format, options, and filename for the parasitic netlist.");
MGCAddSnippet(31, "Use Mask SVDB to create the Standard Database Verification Directory (SVDB). The SVDB directory stores files and directories created by Calibre xACT and Calibre xACT 3D, and Calibre nmLVS/Calibre nmLVS-H for use by Calibre RVE. This option is enabled by default.");
MGCAddSnippet(32, "After you have selected the inputs and the outputs, you are now ready to perform extraction.");
MGCAddSnippet(33, "The Calibre xACT digital extraction flow generates either SPEF or DSPF file output. ");
MGCAddSnippet(34, "Running the Calibre xACT extraction tool in a digital flow requires certain conditions be met. ");
MGCAddSnippet(35, "The Calibre xACT digital flow utilizes certain PEX SVRF statements.");
MGCAddSnippet(36, "Run Calibre xACT digital extraction to create the SPEF netlist. ");
MGCAddSnippet(37, "The Calibre xACT 3D parasitic extraction tool can generate a netlist in a single step or using a three step PDB batch process. ");
MGCAddSnippet(38, "Certain conditions must be met before running the Calibre xACT 3D tool.");
MGCAddSnippet(39, "Use the Calibre xACT 3D direct netlisting flow to perform extraction and generate a netlist in a single step.");
MGCAddSnippet(40, "Use the Calibre xACT 3D PDB flow to create a parasitic database and format a netlist. ");
MGCAddSnippet(41, "The Persistent Hierarchical Database, usually referred to as the PHDB, contains information about your design s layout, connectivity, and devices necessary for calculating the parasitic information. You can create the PHDB with Calibre  nmLVS‑H or Calibre xACT 3D.");
MGCAddSnippet(42, "Once you have created the PHDB, you create the parasitic database (PDB). ");
MGCAddSnippet(43, "As the last step, you produce a netlist or report using the Calibre xACT formatter. The netlist can be in any of several formats such as HSPICE or DSPF. You can also set the formatter to perform different types of reductions to produce netlists that are more easily simulated.");
MGCAddSnippet(44, "The CalibreInteractive PEX Graphical User Interface (GUI) provides an interface to the Calibre xACT 3D tool.");
MGCAddSnippet(45, "The way in which you start Calibre Interactive depends on your tool environment.");
MGCAddSnippet(46, "After you invoke Calibre Interactive PEX, you are prompted to specify a runset. A runset sets default values and can be useful for managing your different types of extractions. ");
MGCAddSnippet(47, "Parasitic extraction requires a pre-defined rules file. Use this procedure to specify and load a rule file in Calibre Interactive. ");
MGCAddSnippet(48, "The source of your layout data varies depending on how you invoked Calibre Interactive and the type of extraction you plan to run.");
MGCAddSnippet(49, "You must specify the design database and format on the Layout tab for the Calibre Interactive PEX run.");
MGCAddSnippet(50, "You can specify to use source names instead of layout names in the extracted netlist.");
MGCAddSnippet(51, "Specify Hcell files using Calibre xACT 3D with Calibre Interactive.");
MGCAddSnippet(52, "Use the Outputs pane to specify the type of extraction.");
MGCAddSnippet(53, "Specify the type of extraction you would like to perform.");
MGCAddSnippet(54, "Specify the PEX netlist filename and output format to generate the parasitic netlist.");
MGCAddSnippet(55, "You can either exclude nets or use only the nets you specify. To decrease netlist size, it is useful to exclude power and ground nets unless they are central to the type of analysis you have planned.");
MGCAddSnippet(56, "Report files are essential for debugging an extraction run. You can generate a PEX report file from Calibre Interactive.");
MGCAddSnippet(57, "You can specify SVDB output options in Calibre Interactive.");
MGCAddSnippet(58, "After you have selected a runfile, and the inputs and outputs, you are ready to perform extraction.");
MGCAddSnippet(59, "You can override Calibre PEX defaults and customize the extracted parasitic netlist by selecting appropriate options which you access via the PEX Options panel. ");
MGCAddSnippet(60, "The Calibre xACT inductance extraction flow extracts parasitic frequency-dependent resistance, self and mutual inductance of interconnects in IC layouts.");
MGCAddSnippet(61, "Certain conditions must be met before running inductance extraction with the Calibre xACT tool.");
MGCAddSnippet(62, "The Calibre xACT inductance extraction flow utilizes certain PEX Inductance SVRF statements.");
MGCAddSnippet(63, "Run Calibre xACT inductance extraction to produce a netlist containing inductance parasitics. ");
MGCAddSnippet(64, "The Calibre xACT extraction engine is able to extract interconnect parasitics in a variety of ways. For example, Hierarchical extraction is usually faster and requires less memory; the hierarchical netlists it creates are also smaller than equivalent non-hierarchical netlists and easier to simulate. ");
MGCAddSnippet(65, "A design can be extracted in several different ways. Which one is right for you depends on your design stage and what you intend to do with the netlist. ");
MGCAddSnippet(66, "Calibre xACT is recommended for digital , block-level, and full-chip GDS based extraction. ");
MGCAddSnippet(67, "The Calibre xACT tool extracts parasitic capacitance and resistance for interconnect nets and produces parasitic netlists for post-layout analysis. ");
MGCAddSnippet(68, "Extract parasitic resistance on specified layers by performing selective resistance extraction with Calibre xACT.");
MGCAddSnippet(69, "Extract frequency-dependent resistance, self and mutual inductance on specified layers by performing selective inductance extraction with Calibre xACT.");
MGCAddSnippet(70, "Calibre xACT allows multiple netlists to be created in a single run. Multiple netlists can also be generated with Calibre xACT 3D using the direct netlisting flow. ");
MGCAddSnippet(71, "3D select extraction (-3dselect) extracts all nets selected for Calibre xACT and a subset of nets defined for Calibre xACT 3D, and combines the results into a single parasitic netlist. Use this flow for high-accuracy extraction of critical nets with field solver accuracy on all layers.");
MGCAddSnippet(72, "Calibre xACT performs flat LEF/DEF extraction in cases where there are no hierarchical sub-blocks in the design. All nets are extracted except for the power and ground nets. ");
MGCAddSnippet(73, "Block-by-block hierarchical extraction extracts each hierarchical sub-block individually, then extracts the top level of the design using black boxes for the sub-blocks. In addition to the top-level SVRF control file, you need a separate SVRF control file for each sub-block in the hierarchy.");
MGCAddSnippet(74, "Full hierarchical LEF/DEF extraction reads in the complete design, which includes the top level and all of the hierarchical DEF blocks. It then flattens the design in memory. This gives the most accurate depiction of the hierarchical design because unique instances of the sub-blocks are extracted within the context of the design as a whole. Calibre xACT has sufficient performance and capacity even for extremely large full-chip designs. ");
MGCAddSnippet(75, "The Calibre xACT digital flow can optionally model coupling effects between nets and fill cells, and can read fill data in DEF, GDS, and OASIS formats. ");
MGCAddSnippet(76, "Calibre xACT automatically performs DEF metal fill extraction when the DEF file has metal fill defined in the FILLS section.");
MGCAddSnippet(77, "The Calibre xACT digital flow can read macro cells in GDSII format and use the GDS geometries in place of those defined in the corresponding macro cells defined in the LEF files. ");
MGCAddSnippet(78, "The parasitic resistance of interconnects varies at different temperatures. To model the resistance variation, it is common to perform temperature variation extraction at the same process corner. By creating multiple netlists at the minimum, typical, and maximum temperature, and performing simulation at all three temperatures, designers can feel confident that the design will perform as expected at all temperatures. ");
MGCAddSnippet(79, "The Calibre xACT digital flow supports extraction of multiple process corners and temperatures in a single run. There is a small overhead for each additional corner, typically less than 10%. ");
MGCAddSnippet(80, "The TSV extraction flow includes the extraction of die or interposer parasitics on both sides of the TSVs, TSV subcircuit insertion, and TSV-to-TSV coupling extraction. TSV extraction is supported in both LEF/DEF (digital) and GDS (analog) extraction flows.");
MGCAddSnippet(81, "Calibre xACT 3D is recommended for parasitic extraction of small cell block and memory designs. ");
MGCAddSnippet(82, "Hybrid xACT 3D/Rule-Based extraction (-3d -hybrid) extracts all nets selected for Calibre xRC and a subset of nets defined for Calibre xACT 3D, and combines the results into a single parasitic database. Use this flow for high-accuracy extraction of critical nets in a full-chip sign-off process.");
MGCAddSnippet(83, "Extraction using boundary conditions allows the extraction of an isolated cell by simulating the parasitic effects of neighboring conductors. This is useful during memory bit cell design to simulate various cell placements and their effects on the memory cell geometries. ");
MGCAddSnippet(84, "Hierarchical memory extraction (-xcell -full) extracts data for each user-defined cell as well as the top level of the design. You can nest any number of cells making it ideal for memory arrays. Each cell is extracted only once, which shortens extraction time and netlist size. Hierarchical memory extraction can only be done in the PDB extraction flow. ");
MGCAddSnippet(85, "Mixed-signal hierarchical extraction generates a parasitic netlist for mixed-signal designs. This type of extraction can only be done in the PDB extraction flow. ");
MGCAddSnippet(86, "Gate-level extraction (‑xcell) extracts global nets down to top-level cells (logic gates or blocks), which you specify using an xcell list. This type of extraction can only be done in the PDB extraction flow. ");
MGCAddSnippet(87, "Transistor-level extraction flattens the design s interconnect nets into a top-level cell. These designs are typically less than 500,000 transistors and, subsequently, produce either lumped or distributed net models suitable for resistance and capacitance net models. The Calibre xACT 3D tool creates net models for your design in the form of netlists and models parasitic capacitance and resistance you use for input to analysis tools. ");
MGCAddSnippet(88, "The Calibre xACT tool uses different parasitic models to perform extraction.");
MGCAddSnippet(89, "There are several sources of parasitic effects in a design.");
MGCAddSnippet(90, "Parasitic models are generally divided into two main types: lumped and distributed. ");
MGCAddSnippet(91, "With distributed resistance extraction, the parasitic resistance of the net is broken into segments representing geometric regions. Capacitance is not modeled. ");
MGCAddSnippet(92, "With distributed resistance and capacitance extraction, the parasitic resistance of the net is broken into segments representing geometric regions. The parasitic capacitance is likewise divided into  local  segments going to the substrate, including the effect of coupled capacitance. ");
MGCAddSnippet(93, "With distributed resistance and coupled capacitance, the parasitic resistance of the net is divided into segments; however, parasitic capacitance is modeled with separate elements for coupled capacitance and intrinsic capacitance (capacitance to substrate). ");
MGCAddSnippet(94, "Extraction can be performed in a variety of ways including extraction type, netlist type, or design hierarchy, and produce various netlists or reports depending on your verification needs. ");
MGCAddSnippet(95, "Running Calibre xACT extraction requires that certain conditions be met. ");
MGCAddSnippet(96, "The  gates  in gate-level extraction refer to logic gates. These and other predefined circuits are listed in the xcell file. Cells listed in the xcell file appear in the netlist as subcircuit instances. Gate-level extraction must follow the Calibre xACT 3D PDB extraction flow. ");
MGCAddSnippet(97, "Create a gate-level netlist using the Calibre xACT direct netlisting flow. ");
MGCAddSnippet(98, "Create a gate-level netlist using the Calibre xACT 3D PDB flow from the command line. ");
MGCAddSnippet(99, "Create a gate-level netlist using Calibre xACT 3D from Calibre Interactive. Calibre Interactive uses the Calibre xACT 3D PDB extraction flow.");
MGCAddSnippet(100, "In transistor-level extraction, devices and nets are examined without regard to cell boundaries. It is the most accurate form of standard Calibre xACT extraction, but also the most resource intensive.");
MGCAddSnippet(101, "Transistor-level netlists do not have any specific required SVRF statements or environment variables. They also do not require hcell or xcell files.");
MGCAddSnippet(102, "Create a transistor-level netlist using the Calibre xACT 3D direct netlisting flow.");
MGCAddSnippet(103, "Transistor-level netlists do not have any specific required SVRF statements or environment variables. They also do not require hcell or xcell files.");
MGCAddSnippet(104, "Perform transistor-level extraction using the Calibre xACT 3D PDB extraction flow from Calibre Interactive. ");
MGCAddSnippet(105, "The difference between full hierarchical extraction and mixed-signal hierarchical extraction is whether or not all xcells are extracted in full and independent of the layout. The xcell file specifies whether each cell is a  regular  cell (no flag or a -c) to be extracted in full or a primitive cell (-p) and not extracted. The invocation and SVRF file are identical. This extraction type is only valid when using the Calibre xACT 3D PDB extraction flow.");
MGCAddSnippet(106, "Create a hierarchical netlist the Calibre xACT 3D from the command line using the PDB extraction flow. ");
MGCAddSnippet(107, "Create a netlist from Calibre Interactive with an SVRF file setup for your type of parasitic extraction, and specifying only the settings particular to producing hierarchical netlists. Extraction performed from Calibre Interactive follows the PDB extraction flow. ");
MGCAddSnippet(108, "Calibre xACT supports die and interposer TSV extraction for both GDS and LEF/DEF designs. TSV extraction includes the extraction of the interposer parasitics on both sides of the TSVs, TSV subcircuit insertion, and TSV to TSV coupling extraction.");
MGCAddSnippet(109, "Create a netlist that inserts a TSV and includes substrate coupling between TSVs in an analog design using the GDS extraction flow.");
MGCAddSnippet(110, "Create a netlist that inserts a TSV and includes coupling capacitance between TSVs in a digital design using the LEF/DEF extraction flow.");
MGCAddSnippet(111, "To validate Calibre xACT output you might create a netlist showing only the intentional devices. This can be done with or without the usual parasitic extraction step. The rule file still contains rules for parasitic extraction. ");
MGCAddSnippet(112, "Netlists without parasitics can be created for any of the flows. ");
MGCAddSnippet(113, "Create an ideal netlist from Calibre Interactive with a working SVRF file, and specifying only the settings particular to producing non-parasitic netlists.");
MGCAddSnippet(114, "To add layout parasitics to a source netlist, you must use the source-based flow. This calculates parasitic effects based on the layout, matches the layout devices to source devices, and attempts to map parasitics. If your source and layout are not close matches (for example, two source resistors are laid out as 24), you will get nodes labeled as  _noxref .");
MGCAddSnippet(115, "Backannotate parasitics to a source netlist from the command line using the Calibre xACT 3D PDB direct netlisting flow.");
MGCAddSnippet(116, "Backannotate parasitics to a source netlist from the command line using the Calibre xACT 3D PDB extraction flow. ");
MGCAddSnippet(117, "Backannotate parasitics to a source netlist from Calibre Interactive. ");
MGCAddSnippet(118, "The capacitance summary report lists total capacitance and the ratio of coupling capacitance for all nets. It is controlled solely by the SVRF statement, PEX Report Netsummary. If the statement is present in the SVRF file, a run will produce the capacitance summary report regardless of other settings.");
MGCAddSnippet(119, "The coupling capacitance report shows the amount of capacitance between specific pairs of nets and calculates how much this coupling capacitance represents of the total coupling on each net.");
MGCAddSnippet(120, "Create a coupled capacitance report from the command-line for any run that includes CC parasitics.");
MGCAddSnippet(121, "Create a coupled capacitance report using Calibre Interactive for any run that includes CC parasitics. Extraction performed from Calibre Interactive follows the PDB extraction flow. ");
MGCAddSnippet(122, "Point-to-point resistance reports output the resistance along a single layout net. The points can be anywhere along the net. The Calibre Interactive interface allows you to turn the report on or off, but the contents of the report are controlled through a separate text file.");
MGCAddSnippet(123, "Create a net resistance report from the command-line using the Calibre xACT 3D PDB extraction flow.");
MGCAddSnippet(124, "Create a net resistance report using Calibre Interactive for any run that includes parasitic resistance. Extraction performed from Calibre Interactive follows the PDB extraction flow. ");
MGCAddSnippet(125, "To extract only the top-level interconnect, list all cells instantiated in the top level in the xcell file. Use the cell names without IDs. Then run extraction using gate-level extraction. This occurs automatically with LEF/DEF layouts.");
MGCAddSnippet(126, "Extraction flows can be customized to handle different types of input. ");
MGCAddSnippet(127, "When performing hierarchical extraction, you define your design s hierarchy for the Calibre xACT tool by identifying the lower-level cells in the design hierarchy.");
MGCAddSnippet(128, "Import GDS descriptions of macrocells and standard cells with Calibre xACT, and use their GDS geometries in place of their LEF equivalents. The LEF and GDS cells must be geometrically identical to ensure accurate results from this flow. ");
MGCAddSnippet(129, "By default, the Calibre xACT 3D tool treats floating signal nets as fixed (grounded) and does not extract them. However, floating nets are not ignored when calculating the capacitance of non-floating nets.");
MGCAddSnippet(130, "Modeling multiple ground regions is performed when you need to reflect multiple ground regions of a design in your simulation, for example, when performing substrate noise analysis. ");
MGCAddSnippet(131, "If you have chemical mechanical polishing (CMP) models, such as CMPA, VCMP, or the database produced by Praesagus  Copper Prediction and Verification software, you can use its calculations for conductor thickness. The CMP data overrides all other methods of calculating thickness, such as PEX Thickness EQN or PEX Table. The Calibre xACT interpreter converts thickness values into the same units used by the extraction.");
MGCAddSnippet(132, "The basic extraction procedures can be fine-tuned to refine the analysis and extraction phase.");
MGCAddSnippet(133, "Calibre xACT runs all stages of extraction including device recognition, parasitic calculations, and netlisting in one step. By default, it performs R-coupled-C (RCC) extraction and generates a single netlist. Use Calibre xACT 3D direct netlisting to activate the fast field solver technology for capacitance extraction.");
MGCAddSnippet(134, "Calibre xACT extracts resistance for a net on a specified layer using the PEX XACT Control SVRF statement. ");
MGCAddSnippet(135, "The Calibre xACT tool supports extraction of devices that do not contain parasitics in the xcells. This is useful for flows where the device models already include the parasitics. For example, when physical layout of devices is done by using device generators or parameterized cells (pcells), and the device models are parameterized to match the layout.");
MGCAddSnippet(136, "Calibre xACT and Calibre xACT 3D can be used together to extract specific nets with field solver accuracy.");
MGCAddSnippet(137, "Calibre xACT and Calibre xACT 3D can be used together to extract specific layers with field solver accuracy.");
MGCAddSnippet(138, "Calibre xACT 3D allows you to control how certain nets are handled during parasitic extraction.");
MGCAddSnippet(139, "Using the Calibre xACT tool, you exclude nets from the extraction run by including the PEX Extract Exclude Standard Verification Rule Format (SVRF) statement in the rule file. When you use this statement, you must list the nets by name you want excluded from the extraction run.");
MGCAddSnippet(140, "PEX Fieldsolver Mode selects the accuracy mode of Calibre xACT 3D. PEX Fieldsolver Mode 200 has a target of 5% total capacitance. Coupling capacitors that are at least 10% of the total capacitance are targeted to be within 10% of a reference field solver.");
MGCAddSnippet(141, "To decouple and ground any coupling capacitors in the parasitic netlist, use the  -g  command line option. ");
MGCAddSnippet(142, "By default, floating nets are treated as grounded during extraction. A floating net is defined as one not connected to a device and lacking port text. (The shapes comprising the floating net may have text attached in other ways such as by Attach without Port Layer Text. Because this does not define port placement, connectivity is not defined and the net remains floating.) ");
MGCAddSnippet(143, "You can set up a rule file for parasitic resistance extraction so that it can be used with Calibre PERC. ");
MGCAddSnippet(144, "Netlist content can vary greatly depending on your design and analysis goals. ");
MGCAddSnippet(145, "The Calibre xACT digital flow supports the extraction of multiple process corners and temperatures in a single run. ");
MGCAddSnippet(146, "The Calibre xACT and Calibre xACT 3D direct netlisting flows support the extraction of multiple process corners in a single run. ");
MGCAddSnippet(147, "Calibre xACT and Calibre xACT 3D support the creation of multiple netlists in a single run. ");
MGCAddSnippet(148, "To output a net, its devices, and the extracted parasitics without additional nets or devices, use the PRUNE keyword as part of the SVRF statement PEX Netlist and perform selected-net extraction using the Calibre xACT 3D PDB flow. ");
MGCAddSnippet(149, "When performing parasitic extraction with the Calibre xACT 3D tool, you can encounter issues with logical pin swapping in a distributed RC parasitic netlist.");
MGCAddSnippet(150, "Normally, the Calibre xACT 3D formatter produces a layout netlist containing source names. The formatter uses the circuit pin order and cell hierarchy in the source netlist instead of the layout netlist when generating the extracted netlist. When you use this flow, the Calibre xACT 3D formatter produces a source netlist containing the extracted parasitics. ");
MGCAddSnippet(151, "Use the PEX Netlist Virtual Connect statement to join a disjoint parasitic model. ");
MGCAddSnippet(152, "The standard behavior is for the Calibre xACT 3D formatter to use the name of a connected port for the name of a net, even if the name of the port is different from the net name in the parasitic model.");
MGCAddSnippet(153, "Within the parasitic model, each probe point exists as an internal connection with a unique probe_name. You will be able to access each probe point by net and probe_name, depending on your simulator s behavior. ");
MGCAddSnippet(154, "Layout properties are calculated and represented in the CalibreView netlist produced by Calibre xACT.");
MGCAddSnippet(155, "Some troubleshooting and integration techniques are provided to address common problems.");
MGCAddSnippet(156, "Integration information is provided for CAD engineers who are deploying pre-configured tools to their engineering groups. ");
MGCAddSnippet(157, "Tips are provided for common optimization problems that CAD engineers are asked to tackle. Optimization is a broad topic, and these suggestions are by no means exhaustive.");
MGCAddSnippet(158, "Analysis techniques are provided for CAD engineers with some simple heuristics to aid in-house troubleshooting. This includes many of the steps used by Siemens support representative for initially diagnosing problems.");
MGCAddSnippet(159, "There are steps you can follow when you get a call from a user who is having trouble. ");
MGCAddSnippet(160, "If you are getting a usage message when you try to invoke Calibre, there is an error in the command line. ");
MGCAddSnippet(161, "Calibre xACT can help you handle parasitic on-chip variation.");
MGCAddSnippet(162, "On-chip variation refers to the inter- and intra-die variation in physical process properties. These variations can cause poor yields.");
MGCAddSnippet(163, "In-die variation and CMP modeling are independent of each other and may be singly or jointly used in extraction.");
MGCAddSnippet(164, "The in-die variation workflow takes into account the in-die variation of resistance and capacitance values in the extraction process.");
MGCAddSnippet(165, "The CMP modeling workflow for modeling chemical-mechanical polishing adds some specialized steps to the extraction process.");
MGCAddSnippet(166, "Calibre xACTView is a 3D layout viewer used to visualize technology stack and design structures for integrated circuit designs in 2D and 3D views. It provides the ability to graphically view the different polygons processed for capacitance extraction as seen by Calibre xACT 3D. ");
MGCAddSnippet(167, "Calibre xACTView accepts an FS3 file as input. The FS3 file is an intermediate file created by the Calibre xACT 3D field solver that contains the technology stack and design structure information. ");
MGCAddSnippet(168, "The Calibre xACTView tool is invoked from the command line.");
MGCAddSnippet(169, "The Calibre xACT View graphical user interface (GUI) has several features.");
MGCAddSnippet(170, "The Calibre xACTView session window opens upon invocation of the tool.");
MGCAddSnippet(171, "The FS3 display window allows you to view the FS3 file data either graphically or as a text file. Select the 3D View tab to graphically display the structure described in the FS3 file. Select the Text View tab to display the contents of the FS3 text file. Note that the Text View is only a viewer; the contents cannot be edited.");
MGCAddSnippet(172, "The Calibre xACTView layer palette controls the appearance of the layers for the displayed structure. The palette lists the layer names and types specified in FS3 file. The layer names are listed in the order they appear in the FS3 file. Use this palette to turn the display of specific layers on or off, change the color of a layer, or control the layer transparency. ");
MGCAddSnippet(173, "The Axes window displays the X, Y, and Z coordinate axes. This view tracks the orientation of the structure shown in the FS3 display window. ");
MGCAddSnippet(174, "The Calibre xACTView GUI has the following menus:");
MGCAddSnippet(175, "The Calibre xACTView toolbars provide quick access to the most commonly used operations. By default the application window contains a horizontal toolbar and a vertical toolbar. These toolbars may be undocked from the main application window or moved within the window allowing you to customize your view. ");
MGCAddSnippet(176, "Ruler Mouse Mode is available when you are in one of the 2D views. Use this tool to measure your structure in microns (um). ");
MGCAddSnippet(177, "Calibre xACT command line options allow you to execute the tool from the command line or with a run script.");
MGCAddSnippet(178, "Calibre tools require that the CALIBRE_HOME environment variable be set. ");
MGCAddSnippet(179, "Reference pages describe the command line invocation syntax for the Calibre xACT and Calibre xACTView tools. ");
MGCAddSnippet(180, "Runs the Calibre nmLVS-H tool and creates the persistent hierarchical database (PHDB) for use by the Calibre xACT tool.");
MGCAddSnippet(181, "Based on the input design data specified in the rule file, Calibre xACT extracts parasitic data, performs parasitic analysis on the preprocessed data, and generates the output netlist.");
MGCAddSnippet(182, "Performs connectivity extraction and device recognition, and creates the persistent hierarchical database (PHDB) for use by the Calibre xACT tool. This command also generates a layout netlist. Use only in the Calibre xACT 3D PDB flow.");
MGCAddSnippet(183, "Extracts parasitic data and performs parasitic analysis on the data within the PHDB. It also generates the Parasitic Databases (PDBs) containing the electrical data for each net.");
MGCAddSnippet(184, "Produces netlists and reports from the PDB contents. Use only in the Calibre xACT 3D PDB flow. ");
MGCAddSnippet(185, "Invokes the Calibre xACTView 3D layout viewer. ");
MGCAddSnippet(186, "Various extraction reduction techniques are available to streamline the extraction process.");
MGCAddSnippet(187, "Use capacitive and resistive reduction to control netlist size and simulation performance.");
MGCAddSnippet(188, "The PEX Reduce Digital statement decreases the size of netlists and databases. ");
MGCAddSnippet(189, "TICER stands for  Time Constant Equilibration Reduction . ");
MGCAddSnippet(190, "Error and warning messages are generated by the Calibre xACT tools at run time. ");
MGCAddSnippet(191, "Error messages must be corrected to continue a Calibre xACT run. ");
MGCAddSnippet(192, "Warning messages should be reviewed to determine if they indicate a real problem in your design.");
MGCAddSnippet(193, "");
MGCAddSnippet(194, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

